&lt;/li&gt;\n&lt;li&gt; deserialize time: 50.20 s &lt;/li&gt;\n&lt;li&gt; transfer time: 4.07 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://169.228.130.74:10288 &lt;/li&gt;\n          &lt;li&gt; Workers: 24 &lt;/li&gt;\n          &lt;li&gt; Threads: 24 &lt;/li&gt;\n          &lt;li&gt; Memory: 111.84 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.04.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.04.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom processor.default_accumulators import desired_output, add_processes_to_output\n\nfrom Tools.helpers import get_samples\nfrom Tools.config_helpers import redirector_ucsd, redirector_fnal\nfrom Tools.nano_mapping import make_fileset, nano_mapping\n\nfrom processor.meta_processor import get_sample_meta\n\noverwrite = True\nlocal = False\n\n# load the config and the cache\ncfg = loadConfig()\n\ncacheName = 'charge_flip_calc'\ncache = dir_archive(os.path.join(os.path.expandvars(cfg['caches']['base']), cacheName), serialized=True)\n\nyear = 2016\n\n# get a python dictionary of all NanoAOD samples\n# The samples definitions can be found in data/samples.yaml\nsamples = get_samples(year)\n\n# make a fileset, taking the definitions in Tools/nano_mapping.py\nfileset = make_fileset(['DY', 'TTZ', 'top',], samples, redirector=redirector_ucsd, small=False)\n#add back in:  \n\n# in order for cutflows to work we need to add every process to the output accumulator\nadd_processes_to_output(fileset, desired_output)\n\nhistograms = sorted(list(desired_output.keys()))\n\n#meta = get_sample_meta(fileset, samples)\n\nchunksize = 25000\n\nif local:\n\n    exe_args = {\n        'workers': 16,\n        'function_args': {'flatten': False},\n        \"schema\": NanoAODSchema,\n        \"skipbadfiles\": True,\n    }\n    exe = processor.futures_executor\n\nelse:\n    from Tools.helpers import get_scheduler_address\n    from dask.distributed import Client, progress\n    \n    scheduler_address = get_scheduler_address()\n    c = Client(scheduler_address)\n    \n    def unique(filename):\n        file, ext = os.path.splitext(filename)\n        counter = 0\n        while os.path.exists(filename):\n            counter += 1\n            filename = file + str(counter) + ext\n        return filename\n\n    tstart = time.time()\n    \n    from dask.distributed import performance_report\n    fname = unique(\"dask-report_chunksize=\" + str(chunksize/1000) + \"K.html\")\n    \n    exe_args = {\n        'client': c,\n        'function_args': {'flatten': False},\n        \"schema\": NanoAODSchema,\n        \"skipbadfiles\": True,\n        'savemetrics': True\n    }\n    exe = processor.dask_executor\n\nif not overwrite:\n    cache.load()\n\nif cfg == cache.get('cfg') and histograms == cache.get('histograms') and cache.get('simple_output'):\n    output = cache.get('simple_output')\n\nelse:\n    print (\"I'm running now\")\n    with performance_report(filename=fname):\n        output = processor.run_uproot_job(\n            fileset,\n            \"Events\",\n            charge_flip_calc(year=year, variations=[], accumulator=desired_output),\n            exe,\n            exe_args,\n            chunksize=chunksize,\n            )\n\n    cache['fileset']        = fileset\n    cache['cfg']            = cfg\n    cache['histograms']     = histograms\n    cache['simple_output']  = output\n    cache.dump()\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"data_source":{"id":"1107"},"glyph":{"id":"1129"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"view":{"id":"1132"}},"id":"1131","type":"GlyphRenderer"},{"attributes":{},"id":"1074","type":"DataRange1d"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;p&gt;&lt;b&gt;Source:&lt;/b&gt
